import React from 'react';

const postSelect = ({options, defaultValue}) => {
  return (
    <div>
    <select>
      <option disabled value="">{defaultValue}</option>
      {options.map(option => 
      <option value={option.value}>
        {option.text}
        </option>
      )}
    </select>
    </div>
  );
};

export default postSelect;
